import React from 'react';
import { AppBar, Toolbar, Typography, Button } from '@mui/material';
import FavoriteIcon from "@mui/icons-material/Favorite";

import { Link } from 'react-router-dom';
import './NavBar.css';

const NavBar = () => {
  return (
    <AppBar position="static">
      <Toolbar disableGutters>
      <FavoriteIcon sx={{ display: { xs: "none", md: "flex" }, mr: 1 }} />

        <Typography variant="h6" className="nav-logo">
          FastSync
        </Typography>
        <div className="nav-buttons">
          <Button color="inherit" component={Link} to="/">Home</Button>
          <Button color="inherit" component={Link} to="/create">Create Project</Button>
          <Button color="inherit" component={Link} to="/instances">List Projects</Button>
        </div>
      </Toolbar>
    </AppBar>
  );
};

export default NavBar;
